import React, { Component } from 'react';
import DataTable from 'react-data-table-component';

const columns = [
    {
        name: 'Nama',
        selector: row => row.nama,
        sortable: true
    },
    {
        name: 'Hobi',
        selector: row => row.hobi,
        sortable: true
    },
];

const data = [
    {
        id: 1,
        nama: 'Rafid',
        hobi: 'Main Game',
    },
    {
        id: 2,
        nama: 'Faishal',
        hobi: 'Futsal',
    },
    {
        id: 3,
        nama: 'Fauzi',
        hobi: 'Mancing',
    },
]

class DataUser extends Component {
    render() {
        return (
            <DataTable
            columns={columns}
            data={data}
            pagination />
        );
    }
}

export default DataUser;
